#
# View "v_coa_all"
#

DROP VIEW IF EXISTS `v_coa_all`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `v_coa_all`
  AS
SELECT
  `t_coa_sbb`.`no_bb`,
  `t_coa_sbb`.`no_sbb`,
  `t_coa_sbb`.`nama_perkiraan`,
  `t_coa_sbb`.`nominal`,
  `t_coa_sbb`.`posisi`,
  't_coa_sbb' AS 'table_source',
  `t_coa_sbb`.`id_cabang`
FROM
  `t_coa_sbb`
UNION ALL
SELECT
  `t_coalr_sbb`.`no_lr_bb` AS 'no_bb',
  `t_coalr_sbb`.`no_lr_sbb` AS 'no_sbb',
  `t_coalr_sbb`.`nama_perkiraan`,
  `t_coalr_sbb`.`nominal`,
  `t_coalr_sbb`.`posisi`,
  't_coalr_sbb' AS 'table_source',
  `t_coalr_sbb`.`id_cabang`
FROM
  `t_coalr_sbb`
ORDER BY `no_sbb`;

#
# View "v_coabb_all"
#

