SELECT
  `t_coalr_bb`.`no_lr_bb` AS 'no_bb',
  `t_coalr_bb`.`nama_perkiraan`,
  `t_coalr_bb`.`nominal`,
  `t_coalr_bb`.`posisi`,
  't_coalr_bb' AS 'table_source'
FROM
